DROP TABLE IF EXISTS comments,productTags,products,users,tags;

CREATE TABLE users
(
  userId int NOT NULL AUTO_INCREMENT,
  email varchar(255) NOT NULL,
  username varchar(31) NOT NULL,
  profileImageUrl varchar(255) NOT NULL,
  bio varchar(511),
  PRIMARY KEY (userId)
);

CREATE TABLE products
(
  productId int NOT NULL AUTO_INCREMENT,
  productName varchar(255) NOT NULL,
  logoUrl varchar(255) NOT NULL,
  version varchar(63) NOT NULL,
  lastUpdate DATE,
  userId int NOT NULL,
  uploadDate DATETIME NOT NULL,
  description varchar(4000),
  overallRate double NOT NULL DEFAULT 0,
  learnability double NOT NULL DEFAULT 0,
  easeOfUse double NOT NULL DEFAULT 0,
  compatibility double NOT NULL DEFAULT 0,
  documentation double NOT NULL DEFAULT 0,
  totalReviews int NOT NULL DEFAULT 0,
  PRIMARY KEY (productId),
  FOREIGN KEY (userId) REFERENCES users(userId)
);

CREATE TABLE comments
(
  commentId int NOT NULL AUTO_INCREMENT,
  commentBody varchar(1023) NOT NULL,
  commentTime DATETIME NOT NULL,
  productId int NOT NULL,
  userId int NOT NULL,
  overallRate int NOT NULL,
  learnability int NOT NULL,
  easeOfUse int NOT NULL,
  compatibility int NOT NULL,
  documentation int NOT NULL,
  PRIMARY KEY (commentId),
  FOREIGN KEY (productId) REFERENCES products(productId) ON DELETE CASCADE ,
  FOREIGN KEY (userId) REFERENCES users(userId)
);

CREATE TABLE tags
(
    tagId int NOT NULL AUTO_INCREMENT,
    tag varchar(25) NOT NULL UNIQUE,
    PRIMARY KEY (tagId)
);

CREATE TABLE productTags
(
    productId int NOT NULL,
    tagId int NOT NULL,
    PRIMARY KEY (productId, tagId),
    FOREIGN KEY (productId) REFERENCES products(productId) ON DELETE CASCADE,
    FOREIGN KEY (tagId) REFERENCES tags(tagId)
);


